import axios from "axios";
import { useState, useEffect } from "react";

const getMovies = async () => {
  const requested = await axios.get(
    `https://api.themoviedb.org/3/discover/movie?api_key=42792e702bdfaa79e4dcffe831c6aa8b&language=en-US&limit=50`
  );
  console.log(requested);
  setMovies(requested.data.results);
};
useEffect(() => {
  getMovies();
}, []);

export default axios;
